	public static void pdfToBase64() {
		// pdf to byte[]
		FileInputStream in = null;
		BufferedInputStream bin = null;
		ByteArrayOutputStream out = null;
		BufferedOutputStream bout = null;
		try {
			in = new FileInputStream("./src/test/io/test1.pdf");
			bin = new BufferedInputStream(in);
			out = new ByteArrayOutputStream();
			bout = new BufferedOutputStream(out);
			byte[] b = new byte[1024];
			int len = bin.read(b);
			System.out.println("len=");
			System.out.println(len);
			System.out.println("b=");
			System.out.println(b.toString());
			while (len > 0) {
				bout.write(b, 0, len);
				len = bin.read(b);
				System.out.println("len=");
				System.out.println(len);
				System.out.println("b=");
				System.out.println(b.toString());
			}
			bout.flush();
			byte[] result = out.toByteArray();
			
			// encode
			String encodedStr = Base64Utils.encodeToString(result);
			System.out.println(encodedStr.length());
			
		} catch (FileNotFoundException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		} finally {
			if (null != in) {
				try {
					in.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
			if (null != bin) {
				try {
					bin.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
			if (null != out) {
				try {
					out.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
			if (null != bout) {
				try {
					bout.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
		}
	}
	
	/**
     * Description: 将base64编码内容转换为Pdf
     * @param  base64编码内容，文件的存储路径（含文件名）
     * @Author fuyuwei
     * Create Date: 2015年7月30日 上午9:40:23
     */
    public static void base64ToPdf(String base64Content,String filePath){
//        BASE64Decoder decoder = new BASE64Decoder();
        BufferedInputStream bis = null;
        FileOutputStream fos = null;
        BufferedOutputStream bos = null;

        try {
//            byte[] bytes = decoder.decodeBuffer(base64Content);//base64编码内容转换为字节数组
            byte[] bytes = Base64Utils.decodeFromString(base64Content);//base64编码内容转换为字节数组
            ByteArrayInputStream byteInputStream = new ByteArrayInputStream(bytes);
            bis = new BufferedInputStream(byteInputStream);
            File file = new File(filePath);
            File path = file.getParentFile();
            if(!path.exists()){
                path.mkdirs();
            }
            fos = new FileOutputStream(file);
            bos = new BufferedOutputStream(fos);

            byte[] buffer = new byte[1024];
            int length = bis.read(buffer);
            while(length != -1){
                bos.write(buffer, 0, length);
                length = bis.read(buffer);
            }
            bos.flush();
        } catch (Exception e) {
            e.printStackTrace();
        }finally{
			try {
				bis.close();
			} catch (IOException e) {
				e.printStackTrace();
			}        	
			try {
				fos.close();
			} catch (IOException e) {
				e.printStackTrace();
			}        	
			try {
				bos.close();
			} catch (IOException e) {
				e.printStackTrace();
			}        	
        }
    }
